import React, { useState } from "react";
import {Button, Drawer} from 'antd';

const settings = {
  position: 'absolute',
  top: '50%',
  right: '5px',
};

const AntSetting = () => (
  <div>
    <Button type="primary" shape="round" icon="setting" style={settings} />
    <Drawer
      title="Basic Drawer"
      placement="right"
      closable={false}
      onClose={this.onClose}
      visible={this.state.visible}
    >
      <p>Some contents...</p>
      <p>Some contents...</p>
      <p>Some contents...</p>
    </Drawer>
  </div>
);

export default AntSetting;
